import React, {useState, useEffect} from 'react';
import {Link, useParams} from 'react-router-dom';
import axios from 'axios';
import {Container, Row, Card, Form, Button, Col} from 'react-bootstrap';
import api from '../services/api';
import qs from 'querystring';

const AddRecipie = () => {
    const initialFormState = {name: '', description: '', execution_time: '', 
    ingredients: '', execution: '', difficulty: '', dish_kind: '', photo: ''};

    const [recipie, setRecipie] = useState(initialFormState);
    const [errorMessage, setErrorMessage] = useState('');

    const handleInputChange = (event) => {
        const {name, value} = event.target;

        setRecipie({...recipie, [name]: value});
    }

    const submitForm = (event) => {
        event.preventDefault();
        console.log(recipie);

        send_form();
    }

    const send_form = async () => {
        api.post('api/recipies/create', qs.stringify(recipie))
        .then(res => {
            console.log(res.message);
        }).catch(error => {
            setErrorMessage(error.response.data);
        })
    }


    return(
        <Container>
        <Row>
            <Col xs={{span: 8, offset: 2}}>
            <Card>
            <Card.Header>Dodaj przepis</Card.Header>
            <Card.Body>
            <Form onSubmit={submitForm}>
            <Form.Group className="mb-3" controlId="dsad">
                <Form.Label>Nazwa potrawy</Form.Label>
                <Form.Control type="text" placeholder="Nazwa potrawy" name="name" value={recipie.name} onChange={handleInputChange} />
            </Form.Group>
            <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
                <Form.Label>Opis</Form.Label>
                <Form.Control as="textarea" placeholder="Opis" name="description" value={recipie.description} onChange={handleInputChange} />
            </Form.Group>
            <Form.Group className="mb-3">
                <Form.Label>Czas wykonania</Form.Label>
                <Form.Control type="text" placeholder="Czas wykonania" name="execution_time" value={recipie.execution_time} onChange={handleInputChange} />
            </Form.Group>
            <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
                <Form.Label>Składniki</Form.Label>
                <Form.Control as="textarea" placeholder="Składniki" name="ingredients" value={recipie.ingredients} onChange={handleInputChange} />
            </Form.Group>
            <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
                <Form.Label>Wykonanie</Form.Label>
                <Form.Control as="textarea" placeholder="Wykonanie" name="execution" value={recipie.execution} onChange={handleInputChange} />
            </Form.Group>
            <Form.Group className="mb-3">
                <Form.Label>Poziom trudności</Form.Label>
                <Form.Select aria-label="Default select example" name="difficulty" value={recipie.difficulty} onChange={handleInputChange} >
                <option value="1">1</option>
                <option value="2">2</option>
                <option value="3">3</option>
                <option value="4">4</option>
                <option value="5">5</option>
                </Form.Select>
            </Form.Group>
            <Form.Group className="mb-3">
                <Form.Label>Rodzaj potrawy</Form.Label>
                <Form.Select aria-label="Default select example" name="dish_kind" value={recipie.dish_kind} onChange={handleInputChange} >
                <option>Open this select menu</option>
                <option value="1">One</option>
                <option value="2">Two</option>
                <option value="3">Three</option>
                </Form.Select>
            </Form.Group>
            <Form.Group controlId="formFile" className="mb-3">
                <Form.Label>Zdjęcie</Form.Label>
                <Form.Control type="text" name="photo" value={recipie.photo} onChange={handleInputChange} />
            </Form.Group>
            <Button variant="primary" type="submit">
                Submit
            </Button>
            </Form>
            </Card.Body>
            </Card>
            </Col>
        </Row>
    </Container>
    )
}

export {AddRecipie};
